import React from 'react';
import './blog.css'

const Blog = () => {
    return (
        <div className='gpt3__blog section__padding' id="blog">
            <div className='gpt3__blog-header'>
                <h1 className='gradient__text'>
                    A lot is happening, We are blogging agout it
                </h1>
            </div>
        </div>
    );
};

export default Blog;
